import React, { Component } from 'react'

class App extends Component {
    constructor(){
        super()
        this.state = {
            isLogged: true
        }
    }

    render (){
        return (
            <div>
                {
                    this.state.isLogged && <button>ZALOGOWANO</button>
                }
            </div>
        )
    }
}

export default App
